18670	7dfc680b-1efd-4ee5-9a85-6decbdef8fdc		说明文字	el-tag	describe	以折合科研经费数/教师人数的比率排序。\n科研项目分数由科研立项分数与科研经费两部分组成。\n•立项分数：以项目有立项通知为准，国家级项目立项按每项20分计算，省部级项目立项按每项10分计算，市级项目按每项5分计算，（各级项目子课题按下一级别项目计算，市级项目子课题不做统计，项目级别由科研处划定、解释。）\n•项目经费以万元为单位，不同学科按归一化经费计算。纵向项目按照立项金额计算；横向项目按照到帐金额计算。国家级项目按照系数5计算。省部级项目按照系数4计算。科技成果转化经费按照系数3计算。市级和区级项目按照系数2计算。其它项目直接按经费额计算。人文社科类项目经费在级别基础上再按照系数3计算。学校配套的经费不计算在内（教育厅项目属于统计范围之内）。经费额汇总后保留一位小数，四舍五入。（科研效益核算）\n加减分项：牵头承担国家重大科研计划项目的，或单项横向项目到账经费额度超过1000万元的/学术失信，项目未完成而受到立项单位点名。\n注：参与其他学院或外单位联合获批的项目，计算方法视具体情况由科技处进行解释。\n	t	f	8	1618540062177	f	f	f	f	0	0	{}	{}	H	{"maxlength":50,"allow_half":false,"max":0,"labelWidth":0,"layout":"colFormItem","options":null}
